const express = require('express');
const router = express.Router();

router.get('/', (req, res) => {
    res.json({
        message: 'Danh sách người dùng',
        users: [
            { id: 1, name: 'Nguyen Van A', email: 'a@gmail.com' },
            { id: 2, name: 'Tran Thi B', email: 'b@gmail.com' }
        ]
    });
});

router.get('/:id', (req, res) => {
